import React from "react";
import "./App.css";
import ToggleComponent from "./components/ToggleComponent";
import FetchComponent from "./components/FetchComponent";

function App() {
  return (
    <div className="App">
      <h1>Toggle Logic, using useToggle custom Hook</h1>
      <ToggleComponent />
      <FetchComponent />
    </div>
  );
}

export default App;
